import types from 'prop-types';
import React from 'react';

// Styles

import './styles.scss';

// ----------------

export const Navbar = ({onClick,links }) => {
  onclick={onClick}


  return (
    <div className="navbar">
      {links.map(({ label }, index) => {
        return (
          <div className = "navbar__item" key={index}>
            <div className="navbar__indicator"></div>
            <a className="navbar__label" href="\#">{label}</a>
          </div>
        );
      })}
    </div>
  );
};


// ----------------

// Type of props

Navbar.propTypes = {
  prop: types.string,
};

// Default value for props

Navbar.defaultProps = {};
